function TableRow( { data }) {
    const keys = Object.keys(data || {});
    // console.log(data)
    return (

        <tbody>
            {
                <tr>
                    {keys.map(key => <td key={key}>{data[key]}</td>)}
                </tr>
            }
        </tbody>
    )
}

export default TableRow;
